import logo from './logo.svg';
import './App.css';
import {useState} from "react";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Stack from 'react-bootstrap/Stack';
import {Routes, Route, Link, useNavigate, Outlet} from 'react-router-dom'
import Calendar from "./Calendar";
import Writing from "./pages/Writing"
import Loading from "./pages/Loading"
import Home from "./pages/Home"


function App() {

    let navigate = useNavigate()
    let [inputMsg, setInputMsg] = useState('')
    let [prompt, setPrompt] = useState('test')

    function predictNextSentence(text, items) {
        return fetch('http://0.0.0.0:8000/', {
            method: 'POST',
            body: JSON.stringify({
                'text': text,
            })
        })
            .then((response) => response.json())
            .then((data) => setPrompt(data));
    }

    function userInput(text, items) {
        return fetch('http://0.0.0.0:8000/user', {
            method: 'POST',
            body: JSON.stringify({
                'text': text,
            })
        })
            .then((response) => response.json())
            .then((data) => setPrompt(data));
    }


    return (
        <div className="App">
            <div>
                <div>
                    <Navbar bg="light" variant="light">
                        <Container>
                            <Navbar.Brand onClick={() => {
                                navigate('/')
                            }}>

                                <Stack gap={0}>
                                    <div className="nav_title_black">마음챙김</div>
                                    <div className="nav_title_blue">다이어리</div>
                                </Stack>

                            </Navbar.Brand>
                            <Nav className="me-auto">
                                <Nav.Link onClick={() => {
                                    navigate('/writing')
                                }}>일기 작성하기</Nav.Link>
                                <Nav.Link onClick={() => {
                                    navigate('/list')
                                }}>일기 돌아보기</Nav.Link>
                            </Nav>
                            <Nav>
                                <Nav.Link>Today<Calendar/></Nav.Link>
                            </Nav>
                        </Container>
                    </Navbar>
                </div>

                <Routes>
                    <Route path="/" element={<div><Home/></div>}/>
                    <Route path="/writing" element={<div><Writing/></div>}/>
                    <Route path="/loading" element={<div><Loading prompt={prompt} setPrompt={setPrompt}/></div>}/>
                    <Route path="/list" element={<div>리스트</div>}/>
                    <Route path="*" element={<div>없는페이지임</div>}/>
                </Routes>


            </div>
        </div>
    );
}


export default App;
